function MonthArrow(props) {

    let newDate = new Date(props.day.getFullYear(), props.day.getMonth() + 1, 1);

    return (
        <div onClick={() => props.changeCurrentDay(newDate)}>
            <p>CLICK ME</p>
        </div>
    );
}

export default MonthArrow;
